import './Public.css'
import { HashLink as Link } from 'react-router-hash-link';

function Pablic() {

  return (
    <>
      <section className='header__resources'>
        <div className='block-text'>
          <h1 className='block-text_title'>Учебный проект студента факультета Веб&#8209;разработки.</h1>
        </div>
        <ul className='block-navigation'>
          <li className='block-navigation__info_list'><button className='block-navigation__button'><Link className='block-navigation__info' to='#about'>О проекте</Link></button></li>
          <li className='block-navigation__info_list'><button className='block-navigation__button'><Link className='block-navigation__info' to='#technologies'>Технологии</Link></button></li>
          <li className='block-navigation__info_list'><button className='block-navigation__button'><Link className='block-navigation__info' to='#student'>Студент</Link></button></li>
        </ul>
      </section>
    </>
  );
}

export default Pablic;
